import React from 'react';
import { Box, Typography, TextField, Button, useTheme } from '@mui/material';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';

function UserDashboard({ tasks, setTasks }) {
  const theme = useTheme();
  const isRTL = theme.direction === "rtl";

  return (
    <Box mt={3} display="flex" flexDirection="row" justifyContent="center">
      {/* ◊ú◊ï◊ó ◊©◊†◊î */}
      <Box
        sx={{
          flex: 1,
          maxWidth: "50%",
          border: "1px solid #ccc",
          borderRadius: "8px",
          padding: "16px",
          marginRight: isRTL ? "16px" : "0",
          marginLeft: isRTL ? "0" : "16px",
          transform: "scale(1.1)", // ◊î◊í◊ì◊ú◊î ◊ë-10%
        }}
      >
        <Typography variant="h6">üìÖ ◊ú◊ï◊ó ◊©◊†◊î</Typography>
        <Calendar />
      </Box>

      {/* ◊®◊©◊ô◊û◊™ ◊û◊©◊ô◊û◊ï◊™ */}
      <Box
        sx={{
          flex: 1,
          maxWidth: "50%",
          border: "1px solid #ccc",
          borderRadius: "8px",
          padding: "16px",
          height: "300px",
          overflowY: "auto",
        }}
      >
        <Typography variant="h6">‚úÖ ◊û◊©◊ô◊û◊ï◊™</Typography>
        <ul>
          {tasks.map((task, index) => (
            <li key={index}>{task.description} {task.completed ? "‚úÖ" : "‚ùå"}</li>
          ))}
        </ul>
      </Box>
    </Box>
  );
}

export default UserDashboard;
